import './App.css';
import HomePage from "./Components/HomePage";
import Image_One from "./assets/Images/Image_One.jpeg";
import Image_Two from "./assets/Images/Image_Two.jpeg";
import Image_Three from "./assets/Images/Image_Three.jpeg";

const employees = [
  {
    name: "Mattew J",
    image: {Image_One},
    title:"Full-Stack Developer",
  },
  {
    name: "Thomas More",
    image: {Image_Two},
    title:"Front End Developer",
  },
  {
    name: " John Doe",
    image: {Image_Three},
    title:"Back End Developer",
  },
];

function App () { 
  return (
    <div className='App'>
      {employees.map (({name, Image_One, Image_Two, Image_Three, title}, index) => {
        return (
          <HomePage key={index} name={name} Image_One={Image_One} Image_Two={Image_Two} Image_Three={Image_Three} title={title} /> 


        );


      }
      )
      };
          <Image_One />
          <Image_Two />
          <Image_Three />

    </div>
  );
    }

export default App;
